create table member (member_id varchar(30) not null, first_name varchar(15), last_name varchar(15), email varchar(50));



create table transaction (transaction_id int not null auto_increment, code varchar(3), member_id varchar(15), amount INT, primary key (transaction_id));




select transaction.transaction_id trx_id, transaction.code trx_code, transaction.amount amount, member.member_id member_id, member.first_name first_name, member.last_name last_name, member.`email`
from member
join transaction on member.member_id = transaction.`member_id`;

create table test (t1 int);



